$(document).ready(function(){"use strict";var t;$(".delete-button").click(function(){t=$(this).data("id"),$.magnificPopup.open({items:{src:"#delete-confirm-modal"},type:"inline"})}),$(".modal-confirm").click(function(){$.ajax({url:baseUrl+"/admin/products/attributes/terms/"+t,type:"DELETE",headers:{"X-CSRF-TOKEN":$("#csrf-token").attr("content")},success:function(){location.href=baseUrl+"/admin/products/attributes/terms?attribute="+$("#attribute-id").val()},error:function(t){$.magnificPopup.close(),new PNotify({title:"Error",text:401==t.status?t.responseText:"Error found while database operation.",type:"error",addclass:"notification-error",icon:"fas fa-times"})}})}),$(".modal-dismiss").click(function(){$.magnificPopup.close()})});